    "xa,xb=np.meshgrid(a,b)\n",
    "sine=(np.sin(xa**2 + xb**2 ))/(xa**2 + xb**2)\n",
    "plt.contourf(xa,xb,sine,cmap=\"jet\")\n",
    "plt.colorbar()\n",
